A common loading scheme that I program at @deltasc_ would typically see the first week opening at 3x8 followed by 3x10 then onto 4x8 and finally at 3x12 ‚úÖ

There is nothing special being done here, it's just managing the volume to ensure progress and adequate recovery without over reaching ‚úÖ

Whenever you see a 3x12, ask yourself or your coach - did I have a prior building phase to get me here? ü§î

